// src/sections/Services/Services.jsx
import React from "react";
import styles from "./Services.module.css";
import FadeIn from "../../components/FadeIn";
import { FaCode, FaPalette, FaTools } from "react-icons/fa"; // Imported icons

const services = [
  {
    title: "Web Development",
    description: "Building responsive and dynamic websites using React, Node.js, and MongoDB.",
    icon: <FaCode />,
  },
  {
    title: "UI/UX Design",
    description: "Creating user-friendly and modern interfaces with smooth animations.",
    icon: <FaPalette />,
  },
  {
    title: "Backend APIs",
    description: "Designing RESTful APIs with Node.js and Express for seamless data flow.",
    icon: <FaTools />,
  },
];

const Services = () => {
  return (
    <section id="services" className={styles.services}>
      <FadeIn>
        <h2>What I Do</h2>
        <div className={styles.servicesGrid}>
          {services.map((service, index) => (
            <div key={index} className={styles.card}>
              <div className={styles.icon}>{service.icon}</div>
              <h3>{service.title}</h3>
              <p>{service.description}</p>
            </div>
          ))}
        </div>
      </FadeIn>
    </section>
  );
};

export default Services;
